import React, { Component } from "react";
import { Fade, Slide } from "react-reveal";

import emailjs, { init } from 'emailjs-com';
init("user_syd1ry7iWAzZ3EvwoKj9V");

class Contact extends Component {
  handleChange(evt) {
    this.setState({
      email: Object.assign({}, { [evt.target.name]: evt.target.value })
    });
  }
  sendMessage(evt) {
    evt.preventDefault();
    emailjs.sendForm('service_bfn7kc1', 'default_template', evt.target);
    this.initializeEmail();
  }
  constructor(props) {
    super(props);
    this.state = {
      email: {
        user_name: '',
        user_email: '',
        contact_number: '',
	contact_subject: '',
        message: ''
      }
    };
  }
  initializeEmail() {
    this.setState({
      email: {
        user_name: '',
        user_email: '',
        contact_number: '',
	contact_subject: 'Freelog Studio Inquiry',
        message: ''
      }
    });
  }
  render() {
    if (!this.props.data) return null;

    const name = this.props.data.name;
    const street = this.props.data.address.street;
    const city = this.props.data.address.city;
    const state = this.props.data.address.state;
    const zip = this.props.data.address.zip;
    const phone = this.props.data.phone;
    const message = this.props.data.contactmessage;

    return (
      <section id="contact">
        <Fade bottom duration={1000}>
          <div className="row section-head">
            <div className="two columns header-col">
              <h1>
                <span>Get In Touch.</span>
              </h1>
            </div>

            <div className="ten columns">
              <p className="lead">{message}</p>
            </div>
          </div>
        </Fade>

        <div className="row">
          <Slide left duration={1000}>
            <div className="eight columns">
              <form onSubmit={ this.sendMessage.bind(this) } id="contactForm" name="contactForm">
                <fieldset>
                  <div>
                    <label htmlFor="contactName">
                      Name <span className="required">*</span>
                    </label>
                    <input
                      type="text"
                      size="35"
                      id="contactName"
                      name="user_name"
                      onChange={this.handleChange.bind(this)}
	              value={this.state.email.user_name}
                    />
                  </div>

                  <div>
                    <label htmlFor="contactEmail">
                      Email <span className="required">*</span>
                    </label>
                    <input
                      type="text"
                      size="35"
                      id="contactEmail"
                      name="user_email"
	              value={this.state.email.user_email}
                      onChange={this.handleChange.bind(this)}
                    />
                  </div>

                  <div>
                    <label htmlFor="contactSubject">Subject</label>
                    <input
                      type="text"
                      size="35"
                      id="contactSubject"
                      name="contact_subject"
	              value={ this.state.email.contact_subject }
                      onChange={this.handleChange.bind(this)}
                    />
                  </div>

                  <div>
                    <label htmlFor="contactMessage">
                      Message <span className="required">*</span>
                    </label>
                    <textarea
                      cols="50"
                      rows="15"
                      id="contactMessage"
	              onChange={ this.handleChange.bind(this) }
                      name="message" value={ this.state.email.message }
                    ></textarea>
                  </div>

                  <div>
                    <button className="submit">Submit</button>
                    <span id="image-loader">
                      <img alt="" src="images/loader.gif" />
                    </span>
                  </div>
                </fieldset>
              </form>

              <div id="message-warning"> Error boy</div>
              <div id="message-success">
                <i className="fa fa-check"></i>Your message was sent, thank you!
                <br />
              </div>
            </div>
          </Slide>

          <Slide right duration={1000}>
            <aside className="four columns footer-widgets">
              <div className="widget widget_contact">
                <h4>Address and Phone</h4>
                <p className="address">
                  {name}
                  <br />
                  {street} <br />
                  {city}, {state} {zip}
                  <br />
                  <span>{phone}</span>
                </p>
              </div>

              <div className="widget widget_tweets">
	    { /*
                <h4 className="widget-title">Latest Tweets</h4>
                <ul id="twitter">
                  <li>
                    <span>
                      This is Photoshop's version of Lorem Ipsum. Proin gravida
                      nibh vel velit auctor aliquet. Aenean sollicitudin, lorem
                      quis bibendum auctor, nisi elit consequat ipsum
                      <a href="./">http://t.co/CGIrdxIlI3</a>
                    </span>
                    <b>
                      <a href="./">2 Days Ago</a>
                    </b>
                  </li>
                  <li>
                    <span>
                      Sed ut perspiciatis unde omnis iste natus error sit
                      voluptatem accusantium doloremque laudantium, totam rem
                      aperiam, eaque ipsa quae ab illo inventore veritatis et
                      quasi
                      <a href="./">http://t.co/CGIrdxIlI3</a>
                    </span>
                    <b>
                      <a href="./">3 Days Ago</a>
                    </b>
                  </li>
                </ul>
	 	*/ }
              </div>
            </aside>
          </Slide>
        </div>
      </section>
    );
  }
}

export default Contact;
